import * as React from "react";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import Modal from "@mui/material/Modal";
import styles from "./scss/AdminModal.scss";
import { AdminModalProps } from "../../types/pages/AdminModalProps";
import {
  Table,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from "@mui/material";

export const AdminModal: React.FC<AdminModalProps> = (props) => {
  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  return (
    <div>
      <Button onClick={handleOpen}>Open modal</Button>
      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        {/* <Box className={styles.modal}>
          <Typography id="modal-modal-title" variant="h6" component="h2">
            Text in a modal
          </Typography>
          <Typography id="modal-modal-description" sx={{ mt: 2 }}>
            Duis mollis, est non commodo luctus, nisi erat porttitor ligula.
          </Typography>
        </Box> */}
        <TableContainer>
          <Table>
            {/* <TableHead> */}
            {props.qStat.questionnaireResponses.map((qNairRes) => (
              <TableRow>
                {qNairRes.questionResponses.map((qResponse) => (
                  <>
                    <TableCell>Q:</TableCell>
                    <TableCell>A:{qResponse.getAnswer()}</TableCell>
                  </>
                ))}
              </TableRow>
            ))}
            <TableRow>
              <TableCell>{`${props.qStat.userId}`}</TableCell>
              <TableCell>{`${props.qStat.count}`}</TableCell>
            </TableRow>
            {/* </TableHead> */}
          </Table>
        </TableContainer>
      </Modal>
    </div>
  );
};
